import Layout from '../components/Layout';
import * as S from "../components/Typography";

export default function Envelopes() {
    return (
        <Layout>
            <S.SubHeading>Product design</S.SubHeading>
            <S.Display>Envelopes payments</S.Display>
        </Layout>
    )
}
